<!DOCTYPE html>
<html>
  <head>
    <title>Page 1</title>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta http-equiv="content-type" content="text/html; charset=utf-8"/>
    <meta name="apple-mobile-web-app-capable" content="yes"/>
    <link href="resources/css/jquery-ui-themes.css" type="text/css" rel="stylesheet"/>
    <link href="resources/css/axure_rp_page.css" type="text/css" rel="stylesheet"/>
    <link href="data/styles.css" type="text/css" rel="stylesheet"/>
    <link href="files/page_1/styles.css" type="text/css" rel="stylesheet"/>
    <script src="resources/scripts/jquery-1.7.1.min.js"></script>
    <script src="resources/scripts/jquery-ui-1.8.10.custom.min.js"></script>
    <script src="resources/scripts/prototypePre.js"></script>
    <script src="data/document.js"></script>
    <script src="resources/scripts/prototypePost.js"></script>
    <script src="files/page_1/data.js"></script>
    <script type="text/javascript">
      $axure.utils.getTransparentGifPath = function() { return 'resources/images/transparent.gif'; };
      $axure.utils.getOtherPath = function() { return 'resources/Other.html'; };
      $axure.utils.getReloadPath = function() { return 'resources/reload.html'; };
    </script>
  </head>
  <body>
    <div id="base" class="">

      <!-- Footer (Dynamic Panel) -->
      <div id="u0" class="ax_default" data-label="Footer">
        <div id="u0_state0" class="panel_state" data-label="State1" style="">
          <div id="u0_state0_content" class="panel_state_content">

            <!-- Footer (Rectangle) -->
            <div id="u1" class="ax_default box_1" data-label="Footer">
              <div id="u1_div" class=""></div>
            </div>
          </div>
        </div>
      </div>

      <!-- Err Del Label (Dynamic Panel) -->
      <div id="u2" class="ax_default" data-label="Err Del Label">
        <div id="u2_state0" class="panel_state" data-label="State1" style="">
          <div id="u2_state0_content" class="panel_state_content">

            <!-- Body (Rectangle) -->
            <div id="u3" class="ax_default box_1" data-label="Body">
              <div id="u3_div" class=""></div>
            </div>
          </div>
        </div>
      </div>

      <!-- Unnamed (Header) -->

      <!-- Header (Dynamic Panel) -->
      <div id="u5" class="ax_default" data-label="Header">
        <div id="u5_state0" class="panel_state" data-label="State1" style="">
          <div id="u5_state0_content" class="panel_state_content">

            <!-- Header (Rectangle) -->
            <div id="u6" class="ax_default box_1" data-label="Header">
              <div id="u6_div" class=""></div>
            </div>

            <!-- Logo (Placeholder) -->
            <div id="u7" class="ax_default placeholder" data-label="Logo">
              <img id="u7_img" class="img " src="images/page_1/logo_u7.png"/>
              <div id="u7_text" class="text ">
                <p><span>Logo</span></p>
              </div>
            </div>

            <!-- User Widget (Dynamic Panel) -->
            <div id="u8" class="ax_default" data-label="User Widget">
              <div id="u8_state0" class="panel_state" data-label="State1" style="">
                <div id="u8_state0_content" class="panel_state_content">

                  <!-- Welcome Message (Group) -->
                  <div id="u9" class="ax_default" data-label="Welcome Message" data-left="0" data-top="0" data-width="129" data-height="27">

                    <!-- Profile (Rectangle) -->
                    <div id="u10" class="ax_default shape ax_default_hidden" data-label="Profile" style="display:none; visibility: hidden">
                      <div id="u10_div" class=""></div>
                      <div id="u10_text" class="text ">
                        <p><span>Profile</span></p>
                      </div>
                    </div>

                    <!-- Settings (Rectangle) -->
                    <div id="u11" class="ax_default shape ax_default_hidden" data-label="Settings" style="display:none; visibility: hidden">
                      <div id="u11_div" class=""></div>
                      <div id="u11_text" class="text ">
                        <p><span>Settings</span></p>
                      </div>
                    </div>

                    <!-- Log Out (Rectangle) -->
                    <div id="u12" class="ax_default shape ax_default_hidden" data-label="Log Out" style="display:none; visibility: hidden">
                      <div id="u12_div" class=""></div>
                      <div id="u12_text" class="text ">
                        <p><span>Log Out</span></p>
                      </div>
                    </div>

                    <!-- Unnamed (Horizontal Line) -->
                    <div id="u13" class="ax_default horizontal_line ax_default_hidden" style="display:none; visibility: hidden">
                      <img id="u13_img" class="img " src="images/page_1/u13.png"/>
                    </div>

                    <!-- Hello (Rectangle) -->
                    <div id="u14" class="ax_default label" data-label="Hello">
                      <div id="u14_div" class=""></div>
                      <div id="u14_text" class="text ">
                        <p><span>Hello, </span></p>
                      </div>
                    </div>

                    <!-- User Name (Rectangle) -->
                    <div id="u15" class="ax_default link_button" data-label="User Name">
                      <div id="u15_div" class=""></div>
                      <div id="u15_text" class="text ">
                        <p><span>Kelsey</span></p>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      <!-- Err Input (Text Field) -->
      <div id="u16" class="ax_default text_field" data-label="Err Input">
        <input id="u16_input" type="text" value="Hello World!" maxlength="20"/>
      </div>

      <!-- Err Del Label (Rectangle) -->
      <div id="u17" class="ax_default label" data-label="Err Del Label">
        <div id="u17_div" class=""></div>
        <div id="u17_text" class="text ">
          <p><span>Error Message:</span></p>
        </div>
      </div>

      <!-- Create Error (HTML Button) -->
      <div id="u18" class="ax_default html_button" data-label="Create Error">
        <input id="u18_input" type="submit" value="Create Error (2s Delay)"/>
      </div>

      <!-- Error Message (Dynamic Panel) -->
      <div id="u19" class="ax_default ax_default_hidden" data-label="Error Message" style="display:none; visibility: hidden">
        <div id="u19_state0" class="panel_state" data-label="State1" style="">
          <div id="u19_state0_content" class="panel_state_content">

            <!-- Unnamed (Rectangle) -->
            <div id="u20" class="ax_default box_3">
              <div id="u20_div" class=""></div>
            </div>

            <!-- Error Label (Rectangle) -->
            <div id="u21" class="ax_default heading_3" data-label="Error Label">
              <div id="u21_div" class=""></div>
              <div id="u21_text" class="text ">
                <p><span>Error!!</span></p>
              </div>
            </div>

            <!-- Unnamed (Rectangle) -->
            <div id="u22" class="ax_default button">
              <div id="u22_div" class=""></div>
              <div id="u22_text" class="text ">
                <p><span>Close</span></p>
              </div>
            </div>

            <!-- Error Message (Rectangle) -->
            <div id="u23" class="ax_default paragraph" data-label="Error Message">
              <div id="u23_div" class=""></div>
              <div id="u23_text" class="text ">
                <p><span>Delay</span></p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </body>
</html>
